import React from "react";

// Begin Component
// __________________________________________________________________________________________

export const DharmaLaxaltClassName = "dharma-laxalt";

/**
 * @name DharmaLaxalt
 * @author Peter Laxalt
 *
 */
export const DharmaLaxalt: React.FunctionComponent = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 215.21 173.21"
    preserveAspectRatio="none"
    style={{ background: "blue", height: "100vh", width: "100vw" }}
    className={`${DharmaLaxaltClassName}`}
  >
    <defs>
      <style
        dangerouslySetInnerHTML={{
          __html: `
          .${DharmaLaxaltClassName}__text {
            font-size: 173.56px;
            font-family: DharmaGothicC-ExBold, Dharma Gothic C;
            font-weight: 700;
            letter-spacing: 0em;

            fill: yellow
          }`,
        }}
      />
    </defs>
    <g>
      <g>
        <text
          className={`${DharmaLaxaltClassName}__text`}
          transform="translate(0 167.53) scale(1.15, 1.35)"
        >
          LAXALT
        </text>
      </g>
    </g>
  </svg>
);
